function setDropdownValues(n,t){n.forEach(function(n){var i=document.createElement("option");i.value=n.value;i.innerHTML=n.description;t.options.add(i)})}function handleBreedDropdown(n,t){if(n==null){alert("Dev error: critterTypeSelect is null");return}if(t==null){alert("Dev error: breedSelect is null");return}var i={};n.addEventListener("change",function(){while(t.options.length>0)t.options.remove(0);var r=n.selectedOptions[0].value;if(r in i){setDropdownValues(i[r],t);return}$.ajax({type:"POST",url:"/CritterEx/GetBreedList",contentType:"application/json",dataType:"json",data:JSON.stringify({CritterTypeId:parseInt(r)})}).done(function(n){setDropdownValues(n,t);i[r]=n})})}